import React from "react";
import { View, Text } from "react-native";

export default function Editar() {
  return (
    <View>
      <Text>Editar Page</Text>
      <View style={styles.conteudo}>
        {/* DIV TÍTULO */}
        <View style={styles.title}>
          <Text style={{ fontSize: 25 }}>Título</Text>
          <TextInput
            placeholder="  Minha Bela Imagem"
            style={styles.inputs}
          ></TextInput>
        </View>

        {/* DIV IMAGEM */}
        <View >
          <Text style={{ fontSize: 25 }}>URL da imagem</Text>
          <TextInput
            placeholder="  https://www.google.com"
            style={styles.inputs}
          ></TextInput>
        </View>

        {/* DIV DESCRIÇÃO */}
        <View style={styles.desc}>
          <Text style={{ fontSize: 25 }}>Descrição</Text>
          <TextInput style={styles.inputDesc}></TextInput>
        </View>
      </View>
    </View>
  );
}
